import React, {useRef} from 'react';
import Styles from './Card.module.css';
import {Button} from '@material-ui/core';
import {Avatar} from '@material-ui/core'
const Card = (props)=>{
    const {src} = props;
    const myRef = useRef();
    return (
        <div ref= {myRef} className = {Styles.Wrapper}>
        {myRef.current.focus}
                <img className = {Styles.container} src = {src} height = '200px'>
                </img>
                    <button className = {Styles.GuardarButton}>
                        GUARDAR
                    </button>
                    <Avatar className = {Styles.OptionsButton}>...</Avatar>
                   
        </div>
    )
}
export default Card;
